import PropTypes from 'prop-types'

const User = ({id})=>{

    return (
        <div>user {id}</div>
    );
}

User.propTypes = {
    id : PropTypes.number.isRequired,
};

User.getInitialProps = async (context) =>{
    
    console.log(context.query.id);
    return {id: parseInt(context.query.id,10)};
}

export default User;
